import React from 'react';

export default function ProgressBar({ step, total }) {
  const percent = Math.round((step / total) * 100);
  return (
    <div className="progress-bar-bg">
      <div
        className="progress-bar-fill"
        style={{ width: percent + '%' }}
      />
    </div>
  );
}
